import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { styled } from '@mui/system';
import { motion } from 'framer-motion';

// Common Container
const PageContainer = styled(Box)({
  maxWidth: '1500px',
  width: '100%',
  margin: '0 auto',
  padding: { xs: '0 15px', sm: '0 20px' },
});

// Hero Section
const HeroSection = styled(Box)(({ theme }) => ({
  backgroundImage: `url('https://images.unsplash.com/photo-1523381210434-271e8be1f52b?ixlib=rb-4.0.3&auto=format&fit=crop&w=1350&q=80')`,
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  height: '80vh',
  width: '100%',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#fff',
  textAlign: 'center',
  position: 'relative',
  '&:before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    background: 'rgba(0, 0, 0, 0.4)',
  },
  [theme.breakpoints.down('sm')]: {
    height: '70vh',
  },
}));

const HeroTitle = styled(Typography)(({ theme }) => ({
  fontSize: { xs: '2.5rem', sm: '3.5rem', md: '4rem' },
  fontWeight: 700,
  letterSpacing: '1px',
  color: '#fff',
  zIndex: 1,
  marginBottom: '20px',
  fontFamily: "'Roboto', sans-serif",
  [theme.breakpoints.down('sm')]: {
    fontSize: '2rem',
  },
}));

const HeroSubtitle = styled(Typography)(({ theme }) => ({
  fontSize: { xs: '1rem', sm: '1.2rem', md: '1.4rem' },
  fontWeight: 400,
  lineHeight: 1.6,
  color: '#fff',
  maxWidth: '700px',
  zIndex: 1,
  marginBottom: '30px',
  fontFamily: "'Roboto', sans-serif",
  [theme.breakpoints.down('sm')]: {
    fontSize: '0.9rem',
    maxWidth: '90%',
  },
}));

// Business Intro Section
const BusinessIntroSection = styled(Box)(({ theme }) => ({
  padding: '60px 0',
  background: '#fff',
  color: '#666',
  textAlign: 'center',
  width: '100%',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  minHeight: '40vh',
  [theme.breakpoints.down('sm')]: {
    padding: '40px 0',
    minHeight: '30vh',
  },
}));

const Subtitle = styled(Typography)(({ theme }) => ({
  fontSize: { xs: '0.9rem', sm: '1rem' },
  fontWeight: 500,
  letterSpacing: '1px',
  textTransform: 'uppercase',
  color: '#28b463', // Accent color from the second footer
  marginBottom: '10px',
  zIndex: 1,
  fontFamily: "'Roboto', sans-serif",
  [theme.breakpoints.down('sm')]: {
    fontSize: '0.8rem',
  },
}));

const MainTitle = styled(Typography)(({ theme }) => ({
  fontSize: { xs: '1.8rem', sm: '2.2rem', md: '2.5rem' },
  fontWeight: 700,
  letterSpacing: '0.5px',
  color: '#333', // Darker title color from the second footer
  fontFamily: "'Roboto', sans-serif",
  marginBottom: '20px',
  zIndex: 1,
  [theme.breakpoints.down('sm')]: {
    fontSize: '1.5rem',
  },
}));

const IntroButton = styled(Button)(({ theme }) => ({
  border: '1px solid #28b463', // Accent color border
  color: '#28b463',
  padding: '8px 25px',
  fontSize: '0.9rem',
  fontWeight: 500,
  borderRadius: '4px', // Simpler, rectangular shape
  textTransform: 'uppercase',
  margin: '0 10px',
  background: '#fff',
  transition: 'all 0.3s ease',
  zIndex: 1,
  '&:hover': {
    background: '#28b463',
    color: '#fff',
    borderColor: '#28b463',
  },
  [theme.breakpoints.down('sm')]: {
    padding: '6px 20px',
    fontSize: '0.8rem',
    margin: '0 5px',
  },
}));

const fadeInUp = {
  hidden: { opacity: 0, y: 20 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.6, ease: 'easeOut' } },
};

const staggerContainer = {
  hidden: { opacity: 0 },
  visible: { opacity: 1, transition: { staggerChildren: 0.2 } },
};

const Home = () => {
  return (
    <Box sx={{ backgroundColor: '#fff' }}> {/* Changed outer background to white */}
      <PageContainer>
        <HeroSection
          component={motion.div}
          initial="hidden"
          animate="visible"
          variants={staggerContainer}
        >
          <HeroTitle variant="h1" component={motion.div} variants={fadeInUp}>
            Premium Oversized Tees
          </HeroTitle>
          <HeroSubtitle variant="h5" component={motion.div} variants={fadeInUp}>
            Discover the ultimate blend of comfort and style with Baa M Boo’s exclusive collection of oversized tees for men and women. Crafted with premium materials for a perfect fit that lasts.
          </HeroSubtitle>
        </HeroSection>
      </PageContainer>

      <PageContainer>
        <BusinessIntroSection
          component={motion.div}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          variants={staggerContainer}
        >
          <Subtitle component={motion.div} variants={fadeInUp}>
            Baa M Boo Since 2025
          </Subtitle>
          <MainTitle component={motion.div} variants={fadeInUp}>
            Discover the ultimate blend of comfort and style with Baa M Boo’s exclusive collection
          </MainTitle>
          <Box
            component={motion.div}
            variants={fadeInUp}
            sx={{ display: 'flex', gap: { xs: '10px', sm: '20px' }, flexWrap: 'wrap', justifyContent: 'center' }}
          >
            <IntroButton href="#shop">Shop Now</IntroButton>
            <IntroButton href="#explore">Explore Our Journey</IntroButton>
          </Box>
        </BusinessIntroSection>
      </PageContainer>
    </Box>
  );
};

export default Home;
